const StudentListPage = () => (
  <React.Fragment>
    <h1>Student List Page</h1>
    {students.map((student, index) => (
      <Link key={index} to={`/detail/${student.studentId}`}>
        <h6>
          {student.studentId} {student.firstName} {student.lastName}
        </h6>
      </Link>
    ))}
  </React.Fragment>
);

export default StudentListPage;
